import styled from "styled-components";


export const HeaderComponent = styled.header`
    display: flex;
    background-color: #646D74;
    width: 100%;
    justify-content: center;
    align-items: center;
    color: #111;
    gap: 2rem;
    padding: 10px 0px;
    overflow: hidden;

    h1{
        margin: 0;
        padding: 0;
    }

    img{
        width: 150px;
        height: auto;
    }

`;
